updateData.functionBody:
var output = {};

for(var url in overrideFiles) {
    var fileEntry = overrideFiles[url];
    if(fileEntry.success) {
        var fileType = fileEntry.type;
        if(!fileType) {
            addError(output,url,fileEntry,"file type not present");
        }

        var processFunction = processFolder[fileType];
        if(!processFunction) {
            addError(output,url,fileEntry,"file type not found");
        }
        else {
            processFunction(output,url,fileEntry);
        }

    }
    else {
        addError(output,url,fileEntry,"Download failed");
    }
}

return output;

var cleanedEntry = {};

var outEntries = [];
var outKeys = [];
var i;

console.log("Preset found: " + url);

if(!fileEntry.data) {
    addError(output,url,fileEntry,"no data in preset override: " + url);
    return;
}

var inEntries = fileEntry.data.entries;
if(inEntries) {
    for(i = 0; i < inEntries.length; i++) {
        var entry = inEntries[i];

        if(entry.type == "key") {
            //expand any child values
            var newEntry = {};
            newEntry.type = "key";
            newEntry.tree = entry.tree;
            newEntry.path = entry.path;
            newEntry.key = entry.entry.k;
            newEntry.input = entry.entry.input;

            outEntries.push(newEntry);

            if((entry.v)&&(entry.input == "enum")) {
                var childPath = newEntry.path.concat([newEntry.key]);
                //make a key entry for each
                for(var value in entry.entry.v) {
                    var childEntry = {}
                    childEntry.type = "value";
                    childEntry.tree = entry.tree;
                    childEntry.path = childPath;
                    childEntry.value = value;

                    outEntries.push(childEntry);
                }
            }

            throwErrorForOtherKeys(entry.entry);
        }
        else {
            var newEntry = {};
            newEntry.type = "value";
            newEntry.tree = entry.tree;
            newEntry.path = entry.path;
            newEntry.value = entry.value;

            outEntries.push(newEntry);
        }




    }
}

var inKeys = fileEntry.data.named_keys;
if(inKeys) {
    for(i = 0; i < inKeys.length; i++) {
        var entry = inKeys[i];
        outKeys.push(entry);
    }
}

var dataPresent = false;
if(outEntries.length > 0) {
    cleanedEntry.entries = outEntries;
    dataPresent = true;
}

if(outKeys.length > 0) {
    cleanedEntry.named_keys = outKeys;
    dataPresent = true;
}

if(dataPresent) {
    addEntry(output,"presets",url,cleanedEntry);
}

