var section = output[sectionTag];
if(section === undefined) {
    section = {};
    output[sectionTag] = section
}
section[fileTag] = fileEntry;

var entry = {};
entry.message = message;
entry.file = fileEntry;
addEntry(output,"error",url,fileEntry);

var output = {};

var entries = {};
output.entries = entries;

var namedKeys = {}
output.namedKeys = namedKeys;

var errors = {};
output.errors = errors;

for(var url in processedOverrideFiles.presets) {
    var fileEntry = processedOverrideFiles.presets[url];

    if(fileEntry.entries) {
        for(var i = 0; i < fileEntry.entries.length; i++) {
            var entry = fileEntry.entries[i];
            try {
                processEntry(entries,entry);
            }
            catch(error) {
                addPresetError(errors,url,entry);
            }
        }
    }

    if(fileEntry.named_keys) {
        for(var i = 0; i < fileEntry.named_keys.length; i++) {
            var entry = fileEntry.named_keys[i];
            processNamedKey(namedKeys,entry);
        }
    }
}

return output;

updateData.supplementalCode:
function processEntry(entries,entry) {
    var entryKey = getEntryKey(entry);

    var entryResults = entries[entryKey];
    if(entryResults === undefined) {
        entryResults = {};
        entries[entryKey] = entryResults;
    }
    addToEntryResults(entryResults,entry);
}

function getEntryKey(entry) {
    if(entry.type == "key") {
        return entry.tree + "|" + entry.path.join(":") + ":" + entry.key;
    }
    else if(entry.type == "value") {
        return entry.tree + "|" + entry.path.join(":") + ":" + entry.value;
    }
    else {
        throw new Error("Unrecognized preset entry type: " + JSON.stringify(entry));
    }
}


function processNamedKey(namedKeys,entry) {

    if(entry.name == "icon") {
        //don't save the icon entries;
        return;
    }

    var entryKey = getNamedKeyKey(entry);

    var entryResults = namedKeys[entryKey];
    if(entryResults === undefined) {
        entryResults = {};
        namedKeys[entryKey] = entryResults;
    }
    addToEntryResults(entryResults,entry);
}

function getNamedKeyKey(entry) {
    return entry.name + ":" + entry.value;
}


function addPresetError(errors,url,entry,message) {
    var errorEntry = {};
    errorEntry.message = message;
    errorEntry.entry = entry;

    var urlErrors = errors[url];
    if(!urlErrors) {
        urlErrors = [];
        errors[url] = urlErrors;
    }
    urlErrors.push(errorEntry);
}

