var output = {};

var entries = {};
output.entries = entries;

for(var tag in presetTable.entries) {
    urlEntry = presetTable.entries[tag];
    var count = getMapCount(urlEntry);
    if(count > 1) {
        entries[tag] = count;
    }
}

var namedKeys = {};
output.namedKeys = namedKeys;

for(var tag in presetTable.namedKeys) {
    urlEntry = presetTable.namedKeys[tag];
    var count = getMapCount(urlEntry);
    if(count > 1) {
        entries[tag] = count;
    }
}

return output;

updateData.supplementalCode:
function getMapCount(object) {
    var count = 0;
    for(var key in object) {
        count++;
    }
    return count;
}
